const name = (code) => {
    let ext = list.find(itm => itm.cca2.toLocaleLowerCase() == code)
    let value = ext ? ext.name : code
    return value
}

const search = (p) => {
    let ext = list.find(itm => itm.name.includes(p))
    let value = ext ? ext : ''
    return value
}

const countryModel = { list, search, name }
export default countryModel